import React from "react";
import "../../normalize.scss";
import "../../base.scss";
import DadosUsuario from "../../components/Cadastro/DadosUsuario";
import View from "../view/view";

function DadosUser(props) {

  const verific = () => {
    if(!!props.history.location.state.email) {
      return true
    } else {false}
  }

  return (
    <View cadastro={verific}>
      <DadosUsuario />
    </View>
  );
}

export default DadosUser;
